import Vue from 'vue'

import ThemeLayout from '@themeLayout'
import ThemeNotFound from '@themeNotFound'
import { injectMixins } from '@app/util'
import rootMixins from '@app/root-mixins'

injectMixins(ThemeLayout, rootMixins)
injectMixins(ThemeNotFound, rootMixins)

export const routes = [
  {
    name: "v-68e6f2092fa4",
    path: "/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/apple/Documents/notes/benNotes/docs/README.md").then(comp => {
        Vue.component("v-68e6f2092fa4", comp.default)
        next()
      })
    }
  },
  {
    path: "/index.html",
    redirect: "/"
  },
  {
    name: "v-d0706c959d2ae",
    path: "/intro/fe-knowledge.html",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/apple/Documents/notes/benNotes/docs/intro/fe-knowledge.md").then(comp => {
        Vue.component("v-d0706c959d2ae", comp.default)
        next()
      })
    }
  },
  {
    name: "v-f2b35aea30c67",
    path: "/react/react-knowledge.html",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/apple/Documents/notes/benNotes/docs/react/react-knowledge.md").then(comp => {
        Vue.component("v-f2b35aea30c67", comp.default)
        next()
      })
    }
  },
  {
    path: '*',
    component: ThemeNotFound
  }
]
